public class InnerEnvironmentLoggingConfigurationFactory(Action<Humidifier.MWAA.EnvironmentTypes.LoggingConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.MWAA.EnvironmentTypes.LoggingConfiguration>
{

    internal InnerEnvironmentModuleLoggingConfigurationFactory SchedulerLogsFactory { get; set; }

    internal InnerEnvironmentModuleLoggingConfigurationFactory TaskLogsFactory { get; set; }

    internal InnerEnvironmentModuleLoggingConfigurationFactory DagProcessingLogsFactory { get; set; }

    internal InnerEnvironmentModuleLoggingConfigurationFactory WebserverLogsFactory { get; set; }

    internal InnerEnvironmentModuleLoggingConfigurationFactory WorkerLogsFactory { get; set; }

    protected override Humidifier.MWAA.EnvironmentTypes.LoggingConfiguration Create()
    {
        var loggingConfigurationResult = CreateLoggingConfiguration();
        factoryAction?.Invoke(loggingConfigurationResult);

        return loggingConfigurationResult;
    }

    private Humidifier.MWAA.EnvironmentTypes.LoggingConfiguration CreateLoggingConfiguration()
    {
        var loggingConfigurationResult = new Humidifier.MWAA.EnvironmentTypes.LoggingConfiguration();

        return loggingConfigurationResult;
    }
    public override void CreateChildren(Humidifier.MWAA.EnvironmentTypes.LoggingConfiguration result)
    {
        base.CreateChildren(result);

        result.SchedulerLogs ??= SchedulerLogsFactory?.Build();
        result.TaskLogs ??= TaskLogsFactory?.Build();
        result.DagProcessingLogs ??= DagProcessingLogsFactory?.Build();
        result.WebserverLogs ??= WebserverLogsFactory?.Build();
        result.WorkerLogs ??= WorkerLogsFactory?.Build();
    }

} // End Of Class

